informacaoComplementar:
A contratação para a participação na 12ª Semana Nacional de Estudos Avançados em Contratos Administrativos – Contratos Week justifica-se pela necessidade de constante capacitação dos servidores públicos que atuam nas áreas de licitações, contratos, assessoria jurídica e fiscalização contratual, especialmente diante dos desafios práticos trazidos pela implantação da Nova Lei de Licitações e Contratos Administrativos (Lei nº 14.133/2021).

Trata-se de um evento de caráter técnico e educacional, amplamente reconhecido no cenário nacional, que reúne especialistas, juristas e profissionais com vasta experiência na área, oferecendo painéis e debates atualizados sobre temas cruciais à administração pública, como:

Gestão e fiscalização de contratos;

Planejamento e execução contratual da nova legislação;

Responsabilidade dos agentes públicos;

Jurisprudência recente dos tribunais de contas e do judiciário;

Boas práticas e governança nas contratações públicas.

A participação no evento permitirá a ampliação dos conhecimentos técnicos dos servidores, promovendo ganhos significativos na eficiência, segurança jurídica e economicidade das contratações realizadas pela Administração Pública. Além disso, o conteúdo ofertado contribui diretamente para o cumprimento dos princípios constitucionais da legalidade, eficiência e transparência, além de mitigar riscos de responsabilização por falhas na execução contratual.

Além disso, a contratação será realizada por inexigibilidade de licitação, conforme previsto no artigo 74, inciso I, da Lei nº 14.133/2021, tendo em vista a inviabilidade de competição, pois trata-se de evento com características singulares, ofertado por empresa reconhecida no mercado pela notória especialização na realização de congressos de alto nível técnico na área de contratações públicas.

